import { View, StyleSheet } from 'react-native';
import StylesSettings from './StyleSetting';
import Header from './Header/Heder';

const Settingspage = () =>{
  return <View style = {StylesSettings.container}>
   <Header></Header>
  </View>
}

export default Settingspage;
